import React from "react";
import { Formik } from "formik";
import { TextField } from "@material-ui/core";

const FormikForm = () => {
  return (
    <div>
      <Formik initialValues={{ Search: "Chicken" }} onSubmit={(data = {})}>
        {() => (
          <form>
            <TextField />
          </form>
        )}
      </Formik>
    </div>
  );
};

export default FormikForm;
